import React from 'react'

function Table(props) {
    return (
      <table>
        <TableHeader />
        <TableBody characterData={props.characterData} />
      </table>
    );
    }
function TableHeader()  {
    return (
      <thead>
        <tr>
          <th>Name</th>
          <th>Job</th>
        </tr>
      </thead>
    );
  }
  function TableBody() {
    return <tbody />
  }

export default Table;
